import Layout from "../components/Layout";
import Container from "@material-ui/core/Container";
import { Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import CardItem from "../components/CardItem";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary
  },
  ayce: {
    textAlign: "center"
  }
}));

const freshRolls = [
  {
    id: 1,
    name: "Yellowtail Delight Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  },
  {
    id: 2,
    name: "Hawaiian Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  },
  {
    id: 3,
    name: "Cucumber Sashimi Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  },
  {
    id: 4,
    name: "Sakura Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  }
];

export default function menu() {
  const classes = useStyles();
  return (
    <Layout>
      <Container maxWidth="md">
        <div className={classes.root}>
          <Grid container spacing={3}>
            <Grid item xs={12}>
              <div className={classes.ayce}>
                <Typography variant="h2">Menu</Typography>
              </div>
            </Grid>

            {freshRolls.map(freshRoll => (
              <Grid item xs={6}>
                <Paper className={classes.paper}>
                  <CardItem
                    key={freshRoll.id}
                    itemName={{ text: `${freshRoll.name}` }}
                    itemDescription={{ text: `${freshRoll.description}` }}
                  ></CardItem>
                </Paper>
              </Grid>
            ))}
          </Grid>
        </div>
      </Container>
    </Layout>
  );
}
